import React from "react";

import jooje from '../../assests/food/jooje.jpg'

const hour = new Date().getHours();
const minute = new Date().getMinutes();
const second = new Date().getSeconds();

const date = new Date().getSeconds();


const food = [
    {
        id:1,
        img:jooje,
        name:"جوجه کباب زعفرانی",
        oldPrice:130000,
        newPrice:110000
    },
]

console.log(date);

const ZoodParty = () => {
  return (
    <sectiont>
      <div className="foodParty">
        <div className="foodParty-title">
          <h2>فود پارتی</h2>
          <div className="foodPart-timer">
            <p>{second}</p>:<p>{minute}</p>:<p>{hour}</p>
          </div>
        </div>
        <div className="foodParty-items">
          <div className="foodParty-items_cart">
            <div className="foodParty-items_cart_img">
              <img src={jooje} alt="" />
            </div>
            <div className="foodParty-items_cart_det">
                <div className="name">
                    <p>جوجه کباب زعفرانی</p>
                </div>
                <div className="price-address">
                    <div className="address"></div>
                    <div className="price">
                        <p className="old">130000<span>تومان</span></p>
                        <p className="new">110000<span>تومان</span></p>
                    </div>
                </div>
            </div>
          </div>
        </div>
      </div>
    </sectiont>
  );
};

export default ZoodParty;
